import json
import re

def parse_markdown_table(markdown):
    lines = markdown.strip().split('\n')
    header = [h.strip() for h in lines[0].strip('|').split('|')]
    data = []
    for line in lines[2:]:
        items = [i.strip() for i in line.strip('|').split('|')]
        if len(items) == len(header):
            row = {}
            for i, key in enumerate(header):
                row[key] = items[i]
            data.append(row)
    return data

def extract_url(markdown_link):
    match = re.search(r'\((.*?)\)', markdown_link)
    if match:
        return match.group(1)
    return None

def update_catalog(catalog_path, ebooks_md, audiobooks_md):
    with open(catalog_path, 'r') as f:
        catalog = json.load(f)

    ebook_data = parse_markdown_table(ebooks_md)
    audiobook_data = parse_markdown_table(audiobooks_md)

    for ebook_item in ebook_data:
        title = ebook_item['Title'].strip()
        for book in catalog['ebooks']:
            if book['title'].strip() == title:
                book['image'] = extract_url(ebook_item['Cover (HD)'])
                book['link'] = extract_url(ebook_item['Buy'])
                break

    for audiobook_item in audiobook_data:
        title = audiobook_item['Title'].strip()
        for book in catalog['audiobooks']:
            if book['title'].strip() == title:
                book['image'] = extract_url(audiobook_item['Cover (HD)'])
                book['link'] = extract_url(audiobook_item['Buy'])
                break

    with open(catalog_path, 'w') as f:
        json.dump(catalog, f, indent=2)

